import React from 'react'

const AttractionSummary = ({attraction}) => {
  return (
    <div >
        <span>{attraction.Id} is een {attraction.Type} { attraction.WaitingTime || attraction.WaitingTime === 0 ? "met een wachttijd van " + attraction.WaitingTime + " minuten!" : null }</span>
    </div>
  )
}

export default AttractionSummary
